import React from "react"

// function auth() {
//     fetch("http://localhost:3000/registration", {
//         method: "post",
//         headers: {
//             'Content-Type': 'application/x-www-form-urlencoded'
//         },
//         mode: "no-cors",
//         body: {
//             "email": document.getElementById('ed_email').value,
//             "password": document.getElementById('ed_password').value
//         }
//     }).then(res => res.text().then(data => console.log(data)))
// }

export default() =>

<div style={{display: "grid"}}>
    <form method = "post">
    <input
      type = "name"
      name = "name"
      id = "ed_name"
      placeholder = "Name"/>

    <input
      type = "email"
      name = "email"
      id = "ed_email"
      placeholder = "Email"/>

    <input
      type = "password"
      name = "password"
      id = "ed_password"
      placeholder = "Password"/>

    <input
      type = "date"
      name = "bornDate"
      id = "ed_bornDate"
      placeholder = "Birth Date"/>

    <select className="gender">
        <option value="Male">Male</option>
        <option value="Female">Female</option>
    </select>

      <button className="register">Register<a href = '/Login'></a></button>

      <div className="back">Back to Login<a href='/Login'></a></div>
    </form>


<style jsx global>{`
    body {
        background: #3EC400;
        font-family: 'Open Sans', sans-serif;
    }

    div {
        margin: 0 auto;
        display: block;
    }

    .register{
        width: 15%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 42.5%;
        display: block;
        font-size: 30px;
        padding: 5px 5px;
    }

    #ed_email{
        width: 30%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 35%;
        display: block;
        font-size: 20px;
        border: none;
        border-radius: 10px;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }

    #ed_password{
        width: 30%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 35%;
        display: block;
        font-size: 20px;
        border-radius: 10px;
        border: none;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }

    #ed_name{
        width: 30%;
        position: relative;
        right: 0;
        margin-top: 15%;
        margin-left: 35%;
        display: block;
        font-size: 20px;
        border: none;
        border-radius: 10px;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }

    #ed_bornDate{
        width: 30%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 35%;
        display: block;
        font-size: 20px;
        border: none;
        border-radius: 10px;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }

    .gender{
        width: 31.5%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 35%;
        display: block;
        font-size: 20px;
        border: none;
        border-radius: 10px;
        padding: 10px 10px;
    }

    .back{
        font-size: 12px;
        position: relative;
        right: 0;
        margin-top: 1%;
        font-size: 12px;
    }
`}</style>
</div>
